window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"22.0.0","implementation":{"name":"cucumber-jvm","version":"7.14.0"},"runtime":{"name":"OpenJDK 64-Bit Server VM","version":"17.0.9+9"},"os":{"name":"Mac OS X"},"cpu":{"name":"x86_64"}}},{"testRunStarted":{"timestamp":{"seconds":1724387577,"nanos":224750000}}},{"source":{"uri":"file:///Users/mathumathibalakrishnan/eclipse/Mathumathi_2024/cucumberdsAlgo/src/test/resources/features/01_DSAlgoRegister.feature","data":"#Author: Mathumathi Balakrishnan\n\n@regression\nFeature: Register\n\n#Register\n\n  Scenario: Verify if user able to register with all empty fields\n    Given The user is on the new user registration page \n    When The user clicks Register button with all fields empty\n    Then The error \"Please fill out this field.\" appears below Username textbox\n\n\nScenario: Verify if user able to register with valid username and other fields empty\n    Given The user is on the new user registration page \n    When The user clicks Register button after entering Username with other fields empty\n    Then The error message \"Please fill out this field.\" appears below Password textbox\n \n   \nScenario: Verify if user able to register with valid username and valid password but other field empty\n    Given The user is on the new user registration page \n    When The user clicks Register button after entering Username and password with Password Confirmation field empty\n    Then Then The error message \"Please fill out this field.\" appears below Password Confirmation textbox    \n \n \nScenario: Verify if user able to register with special characters in username \n    Given The user is on the new user registration page \n    When The user clicks Register button after entering a username with spacebar characters\n    Then The user should see error msg after entering invalid data in username field\n    \n  \nScenario: Verify if user able to register with numeric data in password\n    Given The user is on the new user registration page \n    When The user clicks Register button after entering a password with numeric data \n    Then The user should see error msg after entering invalid data in password field\n\n   \nScenario: Verify if user able to register with password less than 8\n    Given The user is on the new user registration page \n    When The user clicks Register button after entering a Password with characters less than 8\n    Then The user should see error msg after entering invalid data in password field\n\n \nScenario: Verify if user able to register with different passwords in password and password confirmation fields\n    Given The user is on the new user registration page \n    When The user clicks \"Register\" button after entering different passwords in Password and Password Confirmation fields \n    Then  The user should able to see an pwd warning message \"password_mismatch:The two password fields didn’t match.\"\n    \n@sanity  \nScenario: Verify if user able to register with valid data\n    Given The user is on the new user registration page \n    When The user clicks Register button after entering  with valid username, password and password confirmation in related textboxes \n    Then The user should be redirected to Home Page of DS Algo and The user should able to see  successful message \"New Account Created. You are logged in as teamchallengers\"  on  the DS Algo Home Page","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/mathumathibalakrishnan/eclipse/Mathumathi_2024/cucumberdsAlgo/src/test/resources/features/01_DSAlgoRegister.feature","feature":{"location":{"line":4,"column":1},"tags":[{"location":{"line":3,"column":1},"name":"@regression","id":"45a517d4-d317-4ca1-8a1c-fc8f9974d311"}],"language":"en","keyword":"Feature","name":"Register","description":"","children":[{"scenario":{"location":{"line":8,"column":3},"tags":[],"keyword":"Scenario","name":"Verify if user able to register with all empty fields","descript " Page\n    Given The user is in the DataStructure page after logged in\n    When  The user clicks Time Complexity link in Topics covered section\n    Then  The user should be directed to DataStructure Page\n\nScenario: Verify if user able to redirect to a page having an tryEditor with a Run button to test\n    Given The user is in the Time Complexity page \n    When  The user clicks Try Here button in the DataStructure page\n    Then  The user should be redirected to a DataStructure page having an tryEditor with a Run button to test\n  \n  @sanity \n Scenario: Verify if user able to see the output in console\n    Given The user is on the DataStructure tryEditor page \n    When  The User writes Valid python code in DataStructure page\n    And   Click the Run button in DataStructure page\n    Then  User is able to see the output in console of DataStructure page\n    \n Scenario: Verify if user able to see the error msg in pop up window\n   Given The user is on the DataStructure tryEditor page \n   When The user writes invalid python code in DataStructure page\n   And  Click the Run button in DataStructure page\n   Then  User is able to see the error msg in DataStructure page pop up window \n   \n   #Practice Questions\n   \n   Scenario: The user is able to click and navigate to \"Practice Questions\"\n    Given The user is in the Time Complexity page\n    When  The user clicks DataStructurtures Practice Questions link\n    Then  The user is redirected to Practice Questions page","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/mathumathibalakrishnan/eclipse/Mathumathi_2024/cucumberdsAlgo/src/test/resources/features/04_DataStructure.feature","feature":{"location":{"line":4,"column":1},"tags":[{"location":{"line":3,"column":1},"name":"@regression","id":"401c3a38-3a59-4e4d-b5af-02336ef5c836"}],"language":"en","keyword":"Feature","name":"Data Structures- Introduction","description":"","children":[{"background":{"location":{"line":7," hibalakrishnan/eclipse/Mathumathi_2024/cucumberdsAlgo/src/test/resources/features/06_Graph.feature","data":"#Author: Mathumathi Balakrishnan\n\n@regression\nFeature: Graph\n\n# Graph\nBackground: Verify if user is logged in\n     Given The user is on the DS Algo SignIn Page\n     When  The user clicks login button after entering valid \"username\" and valid \"password\"\n     Then   The user should land in Data Structure Home Page  \n\n  Scenario: Verify if user able to direct to \"Graph\" Page\n    Given The user is in the Graph page after logged in\n    When  The user clicks Graph link in Topics covered section\n    Then  The user should be directed to Graph Page\n\nScenario: Verify if user able to redirect to a page having an tryEditor with a Run button to test\n    Given The user is in the Graph page \n    When  The user clicks Try Here button in the graph page\n    Then  The user should be redirected to a graph page having an tryEditor with a Run button to test\n  \n  @sanity  \n Scenario: Verify if user able to see the output in console\n    Given The user is on the Graph tryEditor page \n    When  The User writes Valid python code in graph page\n    And   Click the Run button in graph page\n    Then  User is able to see the output in console of graph page\n    \n Scenario: Verify if user able to see the error msg in pop up window\n   Given The user is on the Graph tryEditor page \n   When The user writes invalid python code in graph page\n   And  Click the Run button in graph page\n   Then  User is able to see the error msg in graph page pop up window \n  \n   \n  Scenario: Verify if user able to direct to \"Graph Representations\" page\n   Given The user is in the Graph page after logged in\n   When The user clicks Graph representations link in Topics covered section\n   Then The user should be directed to Graph representations Page\n  \n   Scenario: Verify if user able to redirect to a page having an tryEditor with a Run button to test\n   Given The user is in the Graph representations page\n   When The user clicks Try Here button in the graph page\n   Then The user should be redirected to a graph page having an tryEditor with a Run button to test\n  \n   @sanity  \n   Scenario: Verify if user able to see the output in console\n   Given The user is on the Graph representations tryEditor page\n   When The User writes Valid python code in graph page\n   And  Click the Run button in graph page\n   Then User is able to see the output in console of graph page\n  \n   Scenario: Verify if user to see the error msg in pop up window\n   Given The user is on the Graph representations tryEditor page\n   When The user writes invalid python code in graph page\n   And  Click the Run button in graph page\n   Then User is able to see the error msg in graph page pop up window \n   \n      \n   #Practice Questions\n   \n   Scenario: The user is able to click and navigate to \"Practice Questions\"\n    Given The user is in the Graph page \n    When  The user clicks Graph Practice Questions link\n    Then  The user is redirected to Graph Practice Questions page\n   ","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/mathumathibalakrishnan/eclipse/Mathumathi_2024/cucumberdsAlgo/src/test/resources/features/06_Graph.feature","feature":{"location":{"line":4,"column":1},"tags":[{"location":{"line":3,"column":1},"name":"@regression","id":"dd8f8be0-707c-4b06-aca1-0bedec9855cc"}],"language":"en","keyword":"Feature","name":"Graph","description":"","children":[{"background":{"location":{"line":7,"column":1},"keyword":"Background","name":"Verify if user is logged in","description":"","steps":[{"location":{"line":8,"column":6},"keyword":"Given ","keywordType":"Context","text":"The user is on the DS Algo SignIn Page","id":"76c4a52d-511c-464f-b2ae-a555ffc4d075"},{"location":{"line":9,"column":6},"keyword":"When ","keywordType":"Action","text":"The user clicks login button after entering valid \"username\" and valid
